sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.name == null || inputs.name.trim() == "")
        throw ("Name cannot be empty or null");
    if (!(inputs.maxNumberOfRetries == null || inputs.maxNumberOfRetries.toString().trim() == "")) {
        var retries = parseInt(inputs.maxNumberOfRetries);

        if (isNaN(retries))
            throw ("Max Number Of Retries must be an integer");
        if (retries < 0)
            throw ("Max Number Of Retries cannot be negative");
        else if (retries > 50)
            throw ("Max Number Of Retries cannot exceed 50");
    }

    var queueDetails = {};

    queueDetails["Name"] = inputs.name;

    if (!(inputs.description == null || inputs.description.trim() == ""))
        queueDetails["Description"] = inputs.description;
    if (!(inputs.autoRetry == null || inputs.autoRetry.toString().trim() == ""))
        queueDetails["AcceptAutomaticallyRetry"] = inputs.autoRetry;
    if (!(inputs.maxNumberOfRetries == null || inputs.maxNumberOfRetries.toString().trim() == ""))
        queueDetails["MaxNumberOfRetries"] = inputs.maxNumberOfRetries;
    if (!(inputs.enforceUniqueReference == null || inputs.enforceUniqueReference.toString().trim() == ""))
        queueDetails["EnforceUniqueReference"] = inputs.enforceUniqueReference;

    outputs.queue_details = JSON.stringify(queueDetails);

})(inputs, outputs);

