sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.statusCode == "200") {
        outputs.status = "Error";
        outputs.error_message = "Invalid Connection URL";
    } else if (inputs.statusCode == "201") {

        try {
            outputs.queue = JSON.parse(inputs.responseBody);
            outputs.status = "Success";
        } catch (e) {
            outputs.status = "Error";
            gs.error(inputs.responseBody);
            outputs.error_message = "Unknown Error. Check error log for more information";
        }
    } else {
        outputs.status = "Error";
        if (inputs.errorMessage.indexOf("Error encountered executing HTTP request") != -1)
            outputs.error_message = "Invalid credentials";
        else {
            var errorHandler = new sn_uipath_spoke.UiPathErrorHandler();
            outputs.error_message = errorHandler.handleErrors(inputs);
        }

    }
})(inputs, outputs);

